<html>
    
    <style>
        .insect { 
  width: 400px;
  height: 400px;
  cursor: pointer;

  background: 
    url(data:image/jpeg;base64,)
    no-repeat
    left center;
   background-size: contain;
}
    </style>
    <body>
    <div class="container">
    <div class="row">
    <h1>Insect as background base64 encoded data</h1>
        <blockquote>This is a sample image just dragged into Sublime Text editor, which then <code>base64</code> encoded the image to a textstring. I then used the long string (<code>background:url(data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAMCAgMCAgMDAwMEAwME...KBH/9k=)</code>) as a background-image in this simple demo. The insect picture is taken using a <a href="http://www.lytro.com">Lytro</a> camera. <br /><strong>Version 1.0</strong> Click on image to tage snapshoot of current zoom using <a href="https://html2canvas.hertzen.com/">html2canvas</a>.</blockquote>
    <label for="size">Scale background</label>
    </div>
    <div class="row">

    <div class="insect" title="click to get screenshoot of current view"></div>
    <img alt="" src="data:image/jpeg;base64," style="height:836px; width:592px">
    </div>
    </body>
</html>